import React from "react";
// import { connect } from "react-redux";
import { Container, Divider, Header, Message } from "semantic-ui-react";

// import ProfileForm from "./ProfileForm";
import FormBuilder from './formBuilder';
const requireFields = [
    {
        type: 'checkbox',
        label: 'T&C',
        name: 'T&C'
    },
    {
        type: 'text',
        label: 'FirstName',
        name: 'firstName',
        placeholder: 'first name'
    },
    {
        type: 'text',
        label: 'LastName',
        name: 'lastName',
        placeholder: 'last name'
    },
    {
        type: 'textField',
        label: 'address',
        name: 'address',
        placeholder: 'placeholder'
    },
    {
        type: 'radio',
        label: 'One',
        name: 'quantity',
        radioValue: 1
    },
    {
        type: 'radio',
        label: 'Two',
        name: 'quantity',
        radioValue: 2
    },
    {
        type: 'select',
        label: 'Gender',
        name: 'gender',
        placeholder: 'gender',
        options: [{ key: "m", text: "Male", value: "male" },
                { key: "f", text: "Female", value: "female" }]
    }
];

const App = props => {
    console.log("props===111111111=>", props);
    return (
        <Container>
            <Divider hidden />

            <Header as="h1" dividing>
                A sample form with Semantic UI React and Redux Form
            </Header>
            {/*<ProfileForm onSubmit={() => console.log("ProfileForm was submitted")} />*/}

            <FormBuilder
                onSubmit={() => console.log("ProfileForm was submitted", props)}
                datas={requireFields}
            />
            <Message>
                <Message.Header>Form data:</Message.Header>
                <pre>{JSON.stringify(props, null, 2)}</pre>
            </Message>
        </Container>
    )
}

